DROP TABLE IF EXISTS `yj_community`;
CREATE TABLE `yj_community` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `area_id` int(11) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL COMMENT '城市',
  `parking` int(255) DEFAULT NULL COMMENT '停车位',
  `name` varchar(255) DEFAULT NULL COMMENT '小区名',
  `Forum` varchar(255) DEFAULT NULL COMMENT '版块',
  `address` varchar(255) DEFAULT NULL COMMENT '小区地址',
  `latitude` varchar(255) DEFAULT NULL COMMENT '经度',
  `longitude` varchar(255) DEFAULT NULL COMMENT '纬度',
  `developers` varchar(255) DEFAULT NULL COMMENT '开发商',
  `company` varchar(255) DEFAULT NULL COMMENT '物业公司',
  `type` varchar(255) DEFAULT NULL COMMENT '物业类型',
  `charge` varchar(255) DEFAULT NULL COMMENT '物业费用',
  `proportion` varchar(255) DEFAULT NULL COMMENT '总建面积',
  `users` varchar(255) DEFAULT NULL COMMENT '总户数',
  `buildyear` varchar(255) DEFAULT NULL COMMENT '建造年代',
  `cubage` varchar(255) DEFAULT NULL COMMENT '容积率',
  `rent` varchar(255) DEFAULT NULL COMMENT '出租率',
  `afforest` double(255,0) DEFAULT NULL COMMENT '绿化率',
  `description` varchar(255) DEFAULT NULL COMMENT '概况',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `is_show` tinyint(4) DEFAULT '1' COMMENT '是否显示（默认显示，1 显示，2 不显示）',
  `state` tinyint(4) DEFAULT '1' COMMENT '''小区状态（1（默认已开通存在对应的store_id对应店铺状态为正在营业和暂停营业具体哪种状态视当前时间与营业时间而定），2（未开通store_id为空对应店铺状态为招商中），3（模拟开通store_id为空对应固定店铺状态为正在营业））''',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10435 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='小区信息表';

