DROP TABLE IF EXISTS `yj_order`;
CREATE TABLE `yj_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT,
  `order_code` varchar(255) NOT NULL COMMENT '订单号',
  `order_price` varchar(50) NOT NULL COMMENT '订单价格',
  `member_id` int(10) unsigned NOT NULL COMMENT '用户id',
  `order_state` int(5) NOT NULL DEFAULT '10' COMMENT '订单状态',
  `add_time` int(11) DEFAULT '0',
  `buy_name` varchar(255) DEFAULT '',
  `buy_tel` varchar(255) DEFAULT '',
  `address` varchar(255) DEFAULT '',
  `msg` varchar(255) DEFAULT '',
  `points` int(11) DEFAULT '0',
  `voucher_id` int(11) DEFAULT '0',
  `area_id` int(11) DEFAULT '0',
  `goods_price` varchar(255) DEFAULT NULL,
  `pay_price` varchar(255) DEFAULT '',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

