# Structure for table "yj_test"
#

DROP TABLE IF EXISTS `yj_test`;
CREATE TABLE `yj_test` (
  `test_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `string` varchar(255) NOT NULL COMMENT '字符串',
  `int` int(10) unsigned NOT NULL COMMENT 'int',
  `text` text NOT NULL COMMENT '文本框',
  `date` int(10) NOT NULL COMMENT '时间',
  `select` char(50) NOT NULL COMMENT '枚举',
  `picture` varchar(255) NOT NULL COMMENT '上传图片',
  `content` text NOT NULL COMMENT '编辑器',
  `pictures` varchar(255) NOT NULL COMMENT '上传多图',
  PRIMARY KEY (`test_id`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

